import { PlayerList } from '/imports/api/playerlist.js';

Meteor.startup(() => {
  var totalUser=PlayerList.find().count();
  if(totalUser<1)
  {
  	populatePlayers();
  }
});

function populatePlayers(){
	PlayerList.insert({
		name: 'Pan Yuehao',
